class IdentificationOfMrz
  MRZ_HOST = CROSS_SITES[:mrz].try(:[],:mrz_host)
  MRZ_TOKEN = CROSS_SITES[:mrz].try(:[],:mrz_token)

  class << self
    def mrz_image(front_image_encode: nil, back_image_encode: nil)
      url = "#{MRZ_HOST}/v0/task/image"
      values = {
          "frontImage": front_image_encode,
          "backImage": back_image_encode,
          "rectoImageCropped": true,
          "signatureImageCropped": true,
          "faceImageCropped": true,
          "asyncMode": false
      }.to_json

      headers = {
          :content_type => 'application/json',
          :authorization => "Basic #{MRZ_TOKEN}",
          :accept_language => 'en'
      }

      response = RestClient.post(url, values, headers){ |response, _, _, _| response }

      parse_response response
    end

    def fetch_analysis_result(uid)
      url = "#{MRZ_HOST}/v0/result/#{uid}?rectoImageCropped=&signatureImageCropped=&faceImageCropped="
      headers = {
          :content_type => 'application/json',
          :authorization => "Basic #{MRZ_TOKEN}",
          :accept_language => 'en'
      }

      response = RestClient.get(url, headers){ |response, _, _, _| response }

      parse_response response
    end

    def fetch_pdfreport(uid)
      url = "#{MRZ_HOST}/v0/pdfreport/#{uid}"

      headers = {
          :content_type => 'application/json',
          :authorization => "Basic #{MRZ_TOKEN}",
          :accept_language => 'en'
      }

      response = RestClient.get(url, headers){ |response, _, _, _| response }

      parse_response response
    end

    def fetch_task_status(uid)
      url = "#{MRZ_HOST}/v0/task/#{uid}"

      headers = {
          :content_type => 'application/json',
          :authorization => "Basic #{MRZ_TOKEN}",
          :accept_language => 'en'
      }

      response = RestClient.get(url, headers){ |response, _, _, _| response }

      parse_response response
    end

    def parse_response(response)
      {
          code: response.code,
          body: (JSON.parse(response.body) rescue response.body.to_s),
      }
    end

    def test
          front_image_encode = ""
      mrz_image(front_image_encode: front_image_encode)
    end
  end
end

